function takeItems(e,t,a){for(var g=e.getItems(),i=0;i<g.length;i++)if(g[i].getDisplayName()==t.getDisplayName()){var s=g[i].getStackSize();g[i].setStackSize(s-a),a-=s}return a<=0}function hasItems(e,t,a){for(var g=e.getItems(),i=0;i<g.length;i++)g[i].getDisplayName()==t.getDisplayName()&&(a-=g[i].getStackSize());return a<=0}function countItems(e,t,a=0){for(var g=e.getItems(),i=0;i<g.length;i++)g[i].getDisplayName()==t.getDisplayName()&&(a+=t.getStackSize());return a}